import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import NavBar from '../public/components/navbar/NavBar';

function App() {
  return (
    <Router>
      <Route path='/'>
        <NavBar />
      </Route>

    </Router>
  );
}

export default App;
